import classes from "./HighlightedTodo.module.css";

const HighlightedTodo = (props) => {
  return (
    <figure className={classes.quote}>
      
      <figcaption>{props.quote.author}</figcaption>
    </figure>
  );
};

export default HighlightedTodo;
